import React from 'react';
// import Menu from './Menu';
// import TableList from './Table';

import $ from 'jquery';

class Bills extends React.Component{
    constructor(props) {
      super(props);

      this.BackTableClick = this.BackTableClick.bind(this);
      this.PayClick = this.PayClick.bind(this);
    }

    BackTableClick(e){
        e.preventDefault(e);
        this.props.BackTableClick(e.target.value);
    }

    PayClick(e){
        e.preventDefault(e);
        this.props.PayClick(e.target.value);
    }

    render(){


        return(
        <div>
            <div class="receipt">
                <div class="receipt_top">
                    <h2>SUN PO</h2>
                    <p>Order Time</p>
                </div>

                <table>
                    <tr class="receipt_color_top">
                        <th>Items</th>
                        <th>Quantity</th>
                        <th>Price</th>
                    </tr>
                    <tr class="receipt_color_mid">
                        <td><div>可樂</div><div>-   多冰</div></td>
                        <td>100</td>
                        <td>700</td>
                    </tr>
                    <tr class="receipt_color_mid">
                        <td><div>可樂</div><div>-   少冰</div></td>
                        <td>100</td>
                        <td>700</td>
                    </tr>
                    <tr class="receipt_color_mid">
                        <td><div>可樂</div><div></div></td>
                        <td>100</td>
                        <td>700</td>
                    </tr>
                    <tr class="receipt_color_mid">
                        <td>可樂</td>
                        <td>100</td>
                        <td>700</td>
                    </tr>
                    <tr class="receipt_color_top">
                        <td></td>
                        <td>Total</td>
                        <td>$2800</td>
                    </tr>
                </table>
            </div>

            <div class="pay_bottom">
                <ul>
                    <li><a onClick={this.BackTableClick.bind(this, "2")}>&lt; Back</a></li>
                    <li><a onClick={this.PayClick}>Pay the bills &gt;</a></li>
                </ul>
            </div>
        </div>






        );
    }
}

export default Bills;
